(63,1,"2019-05-07 22:02:35","2019-05-07 22:02:35","<!-- wp:paragraph -->\n<p>Parkway Baptist Church\'s student ministry focusses on creating a community and developing the faith of students 7th grade and up. Currently our students meet every Sunday for Bible Study and fellowship. They also have regular social outings, such as concerts, movie nights and summer camps.</p>\n<!-- /wp:paragraph -->","Students","","publish","closed","closed","","students","","","2019-05-07 22:02:35","2019-05-07 22:02:35","",0,"http://parkway-baptist-church.local/?post_type=ministries&#038;p=63",1,"ministries","",0),
